import Box from '@mui/material/Box';
import { styled } from '@mui/material/styles';

const DropdownContainer = styled(Box)(({ theme }) => ({
  display: 'none',
  paddingRight: '1.5rem',

  [theme.breakpoints.up('md')]: {
    display: 'inline-flex',
  },
}));

export default DropdownContainer;

